%[text] # photometric attitude estimation using UKF (quaternion only)
%[text] UKFでlight curve attitude estimation
%[text] ## state variables
%[text] ${\\bf x}=\[{\\bf q}^T, {\\bf \\omega}^T\]^T$
%[text] `q`: quaternion where q(4) is the scalar part 
%[text] `w`: angular rate, rad/s
%[text] ## note
%[text] NA
%[text] ## references 
%[text] NA
%[text] ## revisions
%[text] 20220805 y.yoshimura, minor changes
%[text] 20210209  y.yoshimura, y.yoshimula@gmail.com
%[text] See also orbitConst, mainAttiOrbit.
clc
clear
cls
%[text] ## constants
earthVSOP = vsopConst; % VSOP parameters
const = orbitConst; % constants for orbital motion
%%
%[text] ## simulation conditions
% true value calculated by mainAttiOrbit.mlx
fName = "flatPlate"; %[control:dropdown:6070]{"position":[9,20]}
load(strcat(fName,'.mat'));

% random number generator
rng(2022,'twister');
%[text] ## observations and noise
tn_ = length(t_);

sigMapp = 0.1; %[control:editfield:8e23]{"position":[11,14]}
mAppNoise = mApp + sigMapp .* randn(tn_, 1);

% observations
dTmp = vecnorm(obsRel, 2, 2); % m, distance between sat and observer
% mAppInv = magInv(mAppNoise(:,1), dTmp); % true obs. (relative magnitude inverse)
%[text] ## UKF paras.
n_ = 3; % # of state variable := [error GRP and angular rate]

%[text] ### UKF parameters
ukf.alpha = 0.0001; %[control:editfield:9092]{"position":[13,19]}
ukf.beta = 2; %[control:editfield:3af2]{"position":[12,13]}
ukf.kappa = 0; %[control:editfield:22e1]{"position":[13,14]}
ukf.lambda = 0; %[control:editfield:7360]{"position":[14,15]}
ukf = setUKFpara(n_, ukf) %[output:3315cbeb]

% estimated observation noise (standard deviation)
sigEst = 3 * sigMapp;
Rest = sigEst.^2;
Qest = 0 * deg2rad(1e-2)^2 .* eye(3); % process noise

%%
%[text] ### pre-allocation
xEst = zeros(tn_, n_); % [euler angles, angular rates]
p = zeros(tn_, n_); % diagonal components of covariance matrix (Pcov)
qGlobal = zeros(tn_, 4);
ye0 = 0;
yez = zeros(2*n_,1);
yeOut = zeros(tn_, 1);

%%
%[text] ## initial estiamte and covariance
qGlobal(1,:) = q(1,:);  % true initial
tmp = zyx2q(4, deg2rad(-20), ... %[control:editfield:5a48]{"position":[24,27]}
    deg2rad(20), ... %[control:editfield:065a]{"position":[13,15]}
    deg2rad(54)); % initial estimate error of quaternion %[control:editfield:4613]{"position":[13,15]}
qGlobal(1,:) = qMult(4, 1, tmp, q(1,:));

%[text] #### initial covariance for 3$\\sigma\n$bound 
iniErr = deg2rad(400); %[control:editfield:00f6]{"position":[18,21]}
p(1,:) = (iniErr * 3)^2 .* ones(1,3);
Pcov = diag(p(1,:));

% x:= error GRP
xEst(1,:) = zeros(1,n_);
%[text] ### Gneralized Rodrigues parameters
aGRP = 1;
fGRP = 2 * (aGRP + 1);
%%
%[text] ## UKF

for i = 1:tn_-1 %[output:group:81808c6d]
    dt_ = t_(i+1) - t_(i);

    [xEst(i+1,:), qGlobal(i+1,:), Pcov] = lcUKF(jdHistory(i+1), dt_, xEst(i,:), Pcov, mAppNoise(i+1), ... %[output:87e8ed04]
        ukf, Qest, Rest, fGRP, aGRP, qGlobal(i,:), w(i,:), r(i+1,:), obsECI(i+1,:), sat, const, earthVSOP); %[output:87e8ed04]

end %[output:group:81808c6d]

%%
%[text] ## data handling
qe = qErr(4, q, qGlobal);
zyxE = q2zyx(4, qe);
phiE = zyxE(:,1);
thetaE = zyxE(:,2);
psiE = zyxE(:,3);

%[text] ## show figures
figure %[output:20ec53e5]
tiledlayout(4,1),nexttile %[output:20ec53e5]
plot(t_, qe(:,1), 'r') %[output:20ec53e5]
title('error quaternion') %[output:20ec53e5]
nexttile %[output:20ec53e5]
plot(t_, qe(:,2), 'g') %[output:20ec53e5]
nexttile %[output:20ec53e5]
plot(t_, qe(:,3), 'b') %[output:20ec53e5]
nexttile %[output:20ec53e5]
plot(t_, qe(:,4), 'k') %[output:20ec53e5]

figure %[output:90d47a76]
tiledlayout(3,1),nexttile %[output:90d47a76]
plot(t_/60, rad2deg(phiE), 'r') %[output:90d47a76]
title('Euler angle error [deg]') %[output:90d47a76]
xlim([0 60*6]),ylim([-60 60]) %[output:90d47a76]
nexttile %[output:90d47a76]
plot(t_/60, rad2deg(thetaE), 'g') %[output:90d47a76]
xlim([0 60*6]),ylim([-60 60]) %[output:90d47a76]
nexttile %[output:90d47a76]
plot(t_/60, rad2deg(psiE), 'b') %[output:90d47a76]
xlim([0 60*6]),ylim([-60 60]) %[output:90d47a76]


